      {storyUsers.map((user, index) => (
        <div key={index} className="flex flex-col items-center text-sm">
          <div className="w-16 h-16 rounded-full border-2 border-pink-500 flex items-center justify-center text-xl">
            {user}
          </div>
          <span>User {index + 1}</span>
        </div>
      ))}
    </div>
  );
};

export default Stories;
